interface item_data
{
    name: string,
    info: string,
    type: ITEM_TYPE,
    body_layer: BODY_LAYER,
    rarity: number,
    farmability: number,
    hardness: number,
    can_trade: boolean,
    can_trash: boolean,
    can_drop: boolean,
    can_lock: boolean,
    is_solid: boolean
}

const enum BODY_LAYER
{
    none,
    back, //things like capes, wings
    hair,
    headwear, //caps, hats
    eyewear, //visors, sunglasses
    shirt,
    pants,
    hand, //fishing rods, pickaxes
    footwear, //shoes
    skin, //rainbow skin, invisible skin
    pets,
    car,
    neckwear, //scarfs
    facewear //beards, masks
}

